                        svg.prop('height', utils.uint2str(3))
                    ),
                    utils.NULL
                ),

                renderItems(),

                svg.rect(
                    string.concat(
                        svg.prop('fill', 'black'),
                        svg.prop('x', '20'),
                        svg.prop('y', '260'),
                        svg.prop('width', utils.uint2str(190)),
                        svg.prop('height', utils.uint2str(2))
                    ),
                    utils.NULL
                ),
                svg.text(
                    string.concat(
                        svg.prop('x', '20'),
                        svg.prop('y', '280'),
                        svg.prop('font-size', '16'),
                        svg.prop('fill', 'black')
                    ),
                    'Total'
                ),
                svg.text(
                    string.concat(
                        svg.prop('x', '20'),
                        svg.prop('y', '300'),
                        svg.prop('font-size', '16'),
                        svg.prop('fill', 'black')
                    ),
                    Strings.toString(totalPrice)
                ),
                svg.text(
                    string.concat(
                        svg.prop('x', '40'),
                        svg.prop('y', '300'),
                        svg.prop('font-size', '16'),
                        svg.prop('fill', 'black')
                    ),
                    "USD"
                ),
                '</svg>')));
    console.log("\n--------------------");
    console.log(finalSvg);
    console.log("--------------------\n");
    // Actually mint the NFT to the sender using msg.sender.
    _safeMint(msg.sender, newItemId);
    // Set the NFTs data.
    _setTokenURI(newItemId, finalSvg);
    console.log("An NFT w/ ID %s has been minted to %s", newItemId, msg.sender);
    // Increment the counter for when the next NFT is minted.
    _tokenIds.increment();
    emit ReceiptMinted(newItemId);
